import React, { Component } from "react";
import Assets from "./assets";
import { Hfundo } from "styled-components";

class FundosNavBar extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Hfundo>Fundos</Hfundo>
        <div>
          <Assets />
        </div>
      </React.Fragment>
    );
  }
}

export default FundosNavBar;
